import React from 'react';
import { Link, useLocation } from 'react-router-dom';
import styled from 'styled-components';

const NAV_GREEN = '#1ED760';
const NAV_BORDER = '2px solid ' + NAV_GREEN;
const NAV_BG = '#F7F7F5';
const NAV_FONT = 'Inter, system-ui, Arial, sans-serif';
const NAV_MONO = 'Menlo, Monaco, Consolas, "Liberation Mono", "Courier New", monospace';

const NavbarContainer = styled.nav`
  width: 100vw;
  position: sticky;
  top: 0;
  left: 0;
  z-index: 100;
  background: ${NAV_BG};
  border-bottom: 1px solid #E5E5E5;
  display: flex;
  justify-content: flex-start;
  align-items: flex-start;
  font-family: ${NAV_FONT};
  min-height: 64px;
`;

const NavGroup = styled.div`
  display: flex;
  align-items: center;
  background: #fff;
  border: ${NAV_BORDER};
  border-radius: 32px;
  padding: 0.25rem 1.2rem 0.25rem 0.5rem;
  margin: 1.1rem 0 0 2.2rem;
  box-shadow: none;
`;

const Logo = styled(Link)`
  display: flex;
  align-items: center;
  justify-content: center;
  width: 38px;
  height: 38px;
  border-radius: 50%;
  border: ${NAV_BORDER};
  background: #fff;
  color: #222;
  font-family: ${NAV_MONO};
  font-size: 1.1rem;
  font-weight: 700;
  margin-right: 1.1rem;
  text-decoration: none;
  letter-spacing: 0.04em;
  transition: border 0.2s;
`;

const NavLinks = styled.ul`
  display: flex;
  align-items: center;
  gap: 1.2rem;
  list-style: none;
  margin: 0;
  padding: 0;
`;

const NavLink = styled.li`
  a {
    text-decoration: none;
    color: #222;
    font-family: ${NAV_FONT};
    font-size: 1.01rem;
    font-weight: 500;
    text-transform: uppercase;
    letter-spacing: 0.08em;
    padding: 0.1rem 0.2rem;
    border-radius: 4px;
    transition: color 0.18s;
    &:hover, &:focus {
      color: ${NAV_GREEN};
      background: none;
      outline: none;
    }
    &.active {
      color: ${NAV_GREEN};
    }
  }
`;

const RightButton = styled.a`
  position: absolute;
  right: 2.2rem;
  top: 1.1rem;
  background: #222;
  color: #fff;
  font-size: 1rem;
  font-weight: 500;
  border-radius: 6px;
  padding: 0.5rem 1.2rem;
  text-decoration: none;
  transition: background 0.2s;
  border: none;
  &:hover {
    background: #184B54;
  }
`;

const NAV_LINKS = [
  { to: '/work', label: 'Work' },
  { to: '/about', label: 'About' },
  { to: '/journal', label: 'Journal' },
  { to: '/clients', label: 'Clients' },
  { to: '/join', label: 'Join us' },
];

const Navbar = () => {
  const location = useLocation();
  return (
    <NavbarContainer role="navigation" aria-label="Main Navigation">
      <NavGroup>
        <Logo to="/">BB</Logo>
        <NavLinks>
          {NAV_LINKS.map((link) => (
            <NavLink key={link.to}>
              <Link
                to={link.to}
                className={location.pathname === link.to ? 'active' : ''}
                tabIndex={0}
                aria-current={location.pathname === link.to ? 'page' : undefined}
              >
                {link.label}
              </Link>
            </NavLink>
          ))}
        </NavLinks>
      </NavGroup>
      <RightButton href="mailto:hello@example.com">Get in touch</RightButton>
    </NavbarContainer>
  );
};

export default Navbar;
